import React from 'react';
import './Card.css'; // Add styling for cards here

const Card = ({ title, onClick, disabled }) => {
    return (
        <div className="card" onClick={!disabled ? onClick : null}>
            <div className="card-content">
                <h3>{title}</h3>
            </div>
        </div>
    );
};

export default Card;
